setDefaultValueSelect(countrySelect);
const sortedCountries = [...new Set(data.map(row => row['country']))].sort();
for (const country of sortedCountries) {
  const option = document.createElement('option');
  option.value = country;
  option.textContent = country;
  countrySelect.appendChild(option);
}
countrySelect.addEventListener('change', filterData);
filterContainer.append('国')
filterContainer.appendChild(countrySelect);

function filterData() {
  const filteredData = data.filter(row => {
    // 複数選択された<option>要素を取得
    const selectedOptions = Array.from(document.getElementById('year-filter').selectedOptions);

    // 選択された<option>要素のIDと値を格納する配列
    const selectedElementsInfo = selectedOptions.map(option => ({
        id: option.value, // <option>要素自体にID属性がない場合、この値は空文字列になることに注意
        value: option.text
    }));
    const years = selectedElementsInfo.map(item => item.id);

    const year = document.getElementById('year-filter').value;
    const competition = document.getElementById('competition-filter').value.toLowerCase();
    const hostCountry = document.getElementById('hostCountry-filter').value.toLowerCase();
    const region = document.getElementById('region-filter').value;
    const result = document.getElementById('result-filter').value.toLowerCase();
    const country = document.getElementById('country-filter').value.toLowerCase();

    return (
      (year === '' || row['year'] === parseInt(year)) &&
      (competition === '' || row['competition'].toLowerCase().includes(competition)) &&
      (hostCountry === '' || row['hostCountry'].toLowerCase().includes(hostCountry)) &&
      (region === '' || row['region'] === region) &&
      (result === '' || row['result'] == result) &&
      (country === '' || row['country'].toLowerCase().includes(country))
    );
  });

  displayData(filteredData);
}

function setDefaultValueSelect(select) {
  const option = document.createElement('option');
  option.value = '';
  option.textContent = '全て';
  select.appendChild(option);
}

function displayData(data) {
  tableBody.innerHTML = '';

  for (const row of data) {
    const rowElement = tableBody.insertRow();

    for (const key in row) {
      if (key === 'result' && row[key] === '優勝') {
        rowElement.className = "td-1st";
      } else if (key === 'result' && row[key] === '準優勝') {
        rowElement.className = "td-2nd";
      } else if (key === 'result' && (row[key] === '3位' || row[key] === '4位' || row[key] === 'ベスト4')) {
        rowElement.className = "td-best4";
      } else if (key === 'result' && row[key] === 'ベスト8') {
        rowElement.className = "td-best8";
      } else if (key === 'result' && row[key] === 'ベスト16') {
        rowElement.className = "td-best16";
      }
      const cellElement = rowElement.insertCell();
      if (key === 'wikiUrl' || key === 'flashscoreUrl') {
        cellElement.innerHTML  = "<a href='" + row[key] + "' target='_blank'>link</a>";
      } else {
        cellElement.textContent = row[key];
      }
    }
  }
}

// 最初にデータをすべて表示
displayData(data);
